import { cboContext } from "../context/CBOcontext";
import { useContext } from "react";

export const useCBOContext = () => {
    const context = useContext(cboContext)

    if (!context){
        throw Error ('useCBOContext must be used inside a cboContextProvider')
    }
    return context
}
